var NPXL = {};

NPXL.get_npxl = function() {
  var npxl = $.cookie('npxl');
  if (!npxl) {
    npxl = this.create_npxl();
  }
  return npxl;
};

NPXL.create_npxl = function() {
  return this.create_new(Math.floor(Math.random() * 12) + 1);
};

NPXL.create_new = function(n) {
  var value = $.base64.encode("" + n + "," + (new Date()).getTime());
  $.cookie('npxl', value, {
    expires: 30,
    path: '/',
    domain: this.get_domain(),
    secure: false
  });
  return value;
};

NPXL.getn = function() {
  var npxl = $.base64.decode(this.get_npxl());
  return npxl.slice(0, npxl.indexOf(","));
};

NPXL.get_domain = function() {
  var location = window.location.href;
  var re = new RegExp('^(?:f|ht)tp(?:s)?://([^/]+)', 'im');
  var domain = location.match(re)[1].toString();
  var portIndex = domain.indexOf(":");
  if (portIndex != -1) {
    domain = domain.slice(0, portIndex);
  }
  var splitDomain = domain.split(".");
  if (splitDomain.length > 2) {
    domain = "." + splitDomain[splitDomain.length - 2] + "." + splitDomain[splitDomain.length - 1];
  }
  return domain;
};

NPXL.calc = function(data) {
  var estimated_value = +data.calculation.estimated_value;
  var result = estimated_value + this.offset(data);
  if (data.calculation.npxl_lpc && ((+data.calculation.npxl_lpc) >= estimated_value)) {
    return estimated_value;
  }
  return result;
};

NPXL.offset = function(data) {
  var n = NPXL.getn();
  if (data.calculation.estimated_value && data.calculation.offsets && data.calculation.offsets.offset && n <= data.calculation.offsets.offset.length) {
    return +data.calculation.offsets.offset[n - 1];
  } else {
    return 0;
  }
};

NPXL.get_id = function(data) {
  if (data.calculation.npxl_id) {
    return data.calculation.npxl_id;
  }
  return -1;
};

$(document).ready(function(event) {
  NPXL.get_npxl();
});
