//log to sentry on ajax errors
$(document).ajaxError(function(event, jqxhr, settings) {
  var copyNonFunctionProperties = function(from, to) {
    for(var key in from) {
      if(typeof from[key] !== 'function') to[key] = from[key];
    }
    return to;
  };
  if (jqxhr.status === 0) return;
  var status = '' + jqxhr.status + ' ' + jqxhr.statusText,
      message = status + ': ' + settings.url;
  var options = {
    logger: 'ajax',
    tags: {
      ajaxUrl: settings.url,
      ajaxStatus: status
    },
    extra: {
      request: copyNonFunctionProperties(settings, {}),
      response: copyNonFunctionProperties(jqxhr, {
        headers: jqxhr.getAllResponseHeaders(),
        success: jqxhr.success.toString()
      })
    }
  };

  if(window.Raven && Raven.captureMessage) Raven.captureMessage(message, options);
});

function findPos(obj) {
    var curtop = 0;
    if (obj.offsetParent) {
        do {
            curtop += obj.offsetTop;
        } while (obj = obj.offsetParent);
    return [curtop];
    }
}

