function populate_omnilogin_widget(){
  data = findEmailFromCookie();

  if( data !== null ) {
    var email = unescape(data);
    if( $("#omnilogin").length !== 0 && typeof(logged_in_omnilogin_view) !== "undefined" ) {
      $("#omnilogin").html(logged_in_omnilogin_view);
      $("#omnilogin strong.current_user_email").html(email);
    }

    if(window.Raven && Raven.setUser) Raven.setUser({email: email});
  }
}

function findEmailFromCookie(){
  var cookie_prefix = $("#cookie_prefix").html();
  return findRegExInCookie(new RegExp(cookie_prefix + "current_user_email"));
}

function findRegExInCookie(reg_ex){
  cookies = document.cookie.split("; ");
  var data = null;

  $.each(cookies, function(e, arr){
    if(arr.match(reg_ex)){
      data = arr.split("=")[1];
    }
  });
  return data;
}

