function attachValidFormHandlers(parent) {
  var $theForm = findBestParent(parent).find('.valid_form');

  if( $theForm.length > 0 ){
    $theForm.find(".required").change( function(event) {
      basicValidation( $(this).parents(".valid_form") );
    });

    $theForm.find("input[type='text'].required, input[type='password'].required, textarea.required").keyup(function(event) {
      basicValidation( $(this).parents(".valid_form") );
    });

    basicValidation($theForm);
    autoFocusForm($theForm);
  }
}

function autoFocusForm(autoform) {
  if( autoform !== null) {
    var $needsFocus = $(autoform).find(":text:visible:enabled[value='']:first");
    if( $needsFocus.length === 0) {
      $needsFocus = $(autoform).find("input:visible:enabled[value='']:first");
    }
    $needsFocus.focus();
  }
}

function attachDialogFormHandlers(parent) {
  displayFlashMessages('.dialog_flash');

  var $theForm = findBestTarget(parent).find('.dialog_form');

  /* for ajax overlay only */
  if( $theForm.length > 0 ) {
    autoFocusForm($theForm);
    $theForm.submit( function(event) {
      event.preventDefault();
      var parameters = $(this).serializeArray();
      var submit_to = $(this).attr('action');
      $.ajax({
        url: jsonify(submit_to),
        beforeSend: showActivityIndicator($(this)),
        data: parameters,
        dataType: 'json',
        success: handleDialogResponse,
        error: handleDialogError,
        type: 'POST'
      });
    });
  }
}

function handleDialogResponse(results, status, xhr) {
  if (results.html) {
    var $target = findBestTarget(results.target_selector);
    $target.html(results.html);
    attachDialogFormHandlers($target);
    attachValidFormHandlers($target);
    attachOffsiteLinkHandlers();
  } else if (results.reload_page && results.destination_url) {
    document.location = results.destination_url;
  } else if (results.reload_page) {
    location.reload();
  } else if (results.destination_url) {
    /* TODO: Return and re-render the full form--iff any fields tagged with errors */
    $(".errorExplanation").hide();
    $.ajax({
      url: jsonify(results.destination_url),
      dataType: 'json',
      success: handleDialogResponse,
      error: handleDialogError
    });
  }

}

function handleDialogError(XMLHttpRequest, textStatus, errorThrown) {
  hideActivityIndicator();
  alert("We're sorry but an error has occured.");
  $('.overlay .close').click();
}

function showActivityIndicator(parent) {
  var $parent = findBestParent(parent);
  $parent.find(".primary_action:enabled").hide();
  $parent.find(".activity_indicator").show();
}

function hideActivityIndicator(parent) {
  var $parent = findBestParent(parent);
  $parent.find(".activity_indicator").hide();
  $parent.find(".primary_action").show();
}

/* finds the given element or selector on the page, else looks for .overlay, else returns page body. something! */
function findBestParent(parent) {
  var $parent = verifiedJqueryObject( parent );
  if( ! $parent ) {$parent = verifiedJqueryObject( '.overlay' )}
  if( ! $parent ) {$parent = verifiedJqueryObject( 'body' )}
  return $parent;
}

/* finds the given element or selector on the page, else defaults to an overlay's .contentWrap, if it exists */
function findBestTarget(target) {
  var $target = verifiedJqueryObject( target );
  if( ! $target ) {$target = verifiedJqueryObject( '.contentWrap' );}
  return $target;
}

function verifiedJqueryObject(parent) {
  var $parent = $(parent);
  if( $parent.length === 0 ) { $parent = null; }
  return $parent;
}

function jsonify(url) {
  if( url.match("\.json") ) {
    return url;
  } else {
    if( url.match("\\?") ) {
      return url.replace("?", ".json?");
    } else {
      return url + ".json";
    }
  }
}

