function scrollbarWidth() {
    var scr = null;
    var inn = null;
    var wNoScroll = 0;
    var wScroll = 0;

    scr = document.createElement('div');
    scr.style.position = 'absolute';
    scr.style.top = '-1000px';
    scr.style.left = '-1000px';
    scr.style.width = '100px';
    scr.style.height = '50px';
    scr.style.overflow = 'hidden';

    inn = document.createElement('div');
    inn.style.width = '100%';
    inn.style.height = '200px';

    scr.appendChild(inn);
    document.body.appendChild(scr);

    wNoScroll = inn.offsetWidth;
    scr.style.overflow = 'auto';
    wScroll = inn.offsetWidth;

    document.body.removeChild(
        document.body.lastChild);

    return (wNoScroll - wScroll);
}

function basicValidation(formGroup) {
  var allClear = true;
  $(formGroup).find('.required:enabled').each( function() {
    if(jQuery.trim( $(this).val() ) === ''){allClear=false;}
  });
  $(formGroup).find('.confirm:enabled').each(function(){
    allClear = allClear && confirmValidation(this);
  });
  if( allClear ){
    $(formGroup).find('.primary_action').removeAttr("disabled").removeClass('disabled');
  } else {
    $(formGroup).find('.primary_action').attr("disabled",true).addClass('disabled');
  }
  return allClear;
}

function confirmValidation(element){
  element = $(element);

  confirmError = $(element.attr('data-confirm-error'));
  if(confirmError.length) confirmError.hide();

  confirmField = $(element.attr('data-confirm'));
  if(confirmField.length){
    if($.trim(confirmField.val()) != $.trim(element.val())){
      if(confirmError.length) confirmError.show();

      return false;
    }
  }
  return true;
}


