function defaultBeforeLoad(that, id) {
  var wrap = that.getOverlay().find(".contentWrap");
  wrap.html("");
  $(".activity_indicator").show();
  var url = that.getTrigger().attr("href");
  var overlay_id = that.getTrigger().attr("id");
  url = url.replace("?snippet", "?use_snippet");
  Analytics.trackPageview(location.pathname + overlay_id);

  wrap.load(url, function(data) {
    if( data.indexOf("[[redirect]]") != -1 ) {
      window.location = data.replace("[[redirect]] ", "").replace("<!-- ", "").replace(" -->", "");
      return false;
    }
    $(".activity_indicator").hide();
    eval(id + "_overlay_on_completion()");
    overlayFormValidation(wrap);
    overlayFormHandling(wrap);
    eval(id + "_overlay_on_finished()");
  });
}

