(function($) {
  $.fn.activityFeed = function(url) {
    this.each(function() {
      new ActivityFeed(this, url);
    });
  };
})(jQuery);

function ActivityFeed(element, url) {
  this.url = url;
  this.element = $(element);

  this.get = function(){
    var that = this;
    $.ajax({
      url: jsonify(that.url),
      dataType: "json",
      success: function(data) { that.populateActivityFeed(data); }
    });
  }

  this.populateActivityFeed = function(data){
    var that = this;
    if(data != null) {

      $('#activity_feed').hide();

      /*var empty_box_data =
        data[0].type == 'items_in_box' && InlineCart.isBoxEmpty();*/

      var display = false;
      if (data.length > 0) {
        if (data[0].type == 'checkout_in_progress' || data[0].type == 'items_in_box') {
          display = true;
        }
      }

      // TODO: Check on 0 items.

      if (display) {
        var con = data[0].content;
        if (con.split('0 items').length > 1) {
          con = '';
        }
        if (con !== '') {
          $('#activity_feed .cart').html(con);
          $('#activity_feed').fadeIn();
        }
      }

      // Update Alerts
      if (data.length > 0) {
        var cnt = 0
        for(var i = 0; i < data.length; i++) {
          if (data[i].type == 'awaiting_address' || data[i].type == 'trade_response_required' || data[i].type == 'trade_value_changed') {
            cnt++;
          }
        }
        if (cnt > 0) {
          var txt = 'You have <strong>'+cnt+'</strong> alerts.';
          if (cnt == 1) {
            txt = 'You have <strong>'+cnt+'</strong> alert.';
          }
          $('#omnilogin .alerts').show().find('a span').html(txt);
        }
      }

    }

	  $(document).trigger("initialize_cart_link.inline_cart", [$("#inline_cart"), $('#activity_feed .cart')]);
  
  }

  this.get();

}

function update_activity_feed() {
  var has_session     = $.cookie('gzl_server');
  var box_in_progress = $.cookie('current_box');
  var logged_in       = $.cookie('g3_current_user_email');

  if (has_session && (box_in_progress || logged_in)) {
    if (logged_in) {
      $("#activity_feed").activityFeed('/accounts/activity.json');
    } else {
      // TODO: Build the activity feed from the box rather than hitting the server.
      $("#activity_feed").activityFeed('/accounts/activity.json');
    }
  }
}

$(document).ready( function(event) { update_activity_feed(); });
