function displayFlashMessages(targetSelector) {
  Flash.transferFromCookies();
  for (var key in Flash.data) {
    if(Flash.data[key]){ displayFlashMessageFor(key,targetSelector) }
  }
}

function displayFlashMessageFor(flashType,targetSelector) {
  /* standard div in layout */
  if( targetSelector ) {
    $bodyContainer = $(targetSelector);
    if( $bodyContainer.length == 0 ){
      $bodyContainer  = defaultFlashParent();
    }
  } else {
    $bodyContainer  = defaultFlashParent();
  }
  /* what should be put inside it */
  $flashContent   = findOrPrependDivTo('flashContent', $bodyContainer);
  /* std flash wrappers */
  $flashContainer = findOrPrependDivTo('flash_'+flashType, $flashContent, "class='flash'");
  Flash.writeDataTo(flashType,$flashContainer);
}

function defaultFlashParent() {
  return findOrPrependDivTo('body_container', 'body');
}

function findOrPrependDivTo(targetID, parentSelector, targetParams) {
  $container = $('#'+targetID);
  if( $container.length == 0 ) {
    if(targetParams==null){targetParams=''}
    $container = $('<div id="'+targetID+'" '+targetParams+'></div>');
    $container.prependTo($(parentSelector));
  }
  return $container;
}
