var g3;
if (!g3) g3 = {};
if (!g3.search_logging) g3.search_logging = {}

g3.search_logging.mark_search_request = function(request_type, initiated_element, search_entered) {
  var d = new Date();
  var request_params = {
    initiated_url: document.location.href,
    initiated_element: initiated_element,
    search_entered: search_entered,
    cookie_token: $.cookie("_gzl_id"),
    unique_token: $.cookie("_gzl_id") + d.getTime(),
    request_type: request_type
  }
  $.cookie("search_request", JSON.stringify(request_params), { path: "/" });
}

g3.search_logging.log_search_request_and_response = function(type, suggestions) {
  if ($.cookie("search_request") !== null) {
    var request_params = JSON.parse($.cookie("search_request"));
    if( request_params !== null ) {
      var referrer = document.referrer;
      if( type !== 'autocomplete' && request_params.request_type !== 'refinement' ) {
        if( typeof(request_params.initiated_url) === 'undefined' || document.referrer !== request_params.initiated_url ) {
          return false;
        }
      }
      
      var suggested_products = [];
      $.each(suggestions, function(index, val) {
        suggested_products.push({ type: "Product", id: val });
      });
      
      var params = {
        initiated_url: request_params.initiated_url,
        initiated_element: request_params.initiated_element,
        search_entered: request_params.search_entered,
        cookie_token: request_params.cookie_token,
        unique_token: request_params.unique_token,
        request_type: request_params.request_type,
        outcome: {
          destination_url: document.location.href,
          outcome_type: type,
          suggestions: suggested_products
        }
      };
      g3.search_logging.execute_logging(params);
    }
  }
}

g3.search_logging.mark_selection = function(product_id) {
  if ($.cookie("search_request") !== null) {
    var request_params = JSON.parse($.cookie("search_request"));
    if( request_params !== null ) {
      var selection_params = {
        unique_token: request_params.unique_token,
        outcome: {
          selection: {type: "Product", id: product_id}
        }
      }
      $.cookie("search_selection", JSON.stringify(selection_params), { path: "/" });
    }
  }
}

g3.search_logging.log_selection = function() {
  if ($.cookie("search_selection") !== null) {
    var selection_params = JSON.parse($.cookie("search_selection"));
    if( selection_params !== null ) {
      g3.search_logging.execute_logging(selection_params);
    }
  }
}

g3.search_logging.execute_logging = function(params) {
  if( g3.search_logging.active() ) {
    var script_tag = $("<script />");
    var host = g3.search_logging.host;
    var path = "/searches/log";
    var query = escape(JSON.stringify(params));
    script_tag.attr("src", "//"+host+path+"?entry="+query);
    script_tag.attr("charset", "utf-8");
    script_tag.attr("type", "text/javascript");
    $("body").append(script_tag);
  }
}

g3.search_logging.active = function() {
  if($.cookie("search_logging_die_roll") == null) {
    $.cookie("search_logging_die_roll", (random_number(100)/100), { path: "/" });
  }
  return ($.cookie("search_logging_die_roll") <= g3.search_logging.threshold);
}

g3.search_logging.attach_logging_handlers = function() {
  $(".loggable_keyword_search").submit( function(event) {
    g3.search_logging.mark_search_request( "keyword", $(this).attr("id"), $(this).find(".text_field").val() );
  });
  $(".loggable_browse_links a").click( function(event) {
    g3.search_logging.mark_search_request( "browse", $(this).parents(".loggable_browse_links").attr("id"), $(this).html() );
  });
  $(".loggable_product_link").click( function(event) {
    event.stopPropagation();
    event.preventDefault();
    var selected_id = /(\d+)-gpid/.exec($(this).attr("href"));
    g3.search_logging.mark_selection(selected_id[1]);
    document.location = $(this).attr("href");
  });
  $(".loggable_refinement_link").click( function(event) {
    g3.search_logging.mark_search_request("refinement", null, g3.search_logging.current_facet + "::" + $(this).html());
  });
}

$(function() {
  g3.search_logging.attach_logging_handlers();
});




// Home Page JS

if(typeof String.prototype.trim !== 'function') {
  String.prototype.trim = function() {
    return this.replace(/^\s+|\s+$/g, '');
  };
}

function in_array(val, arr) {
  for(var i = 0; i < arr.length; i++) {
    if (arr[i] == val) {
      return true;
    }
  }
  return false;
}

function getUrlVars() {
    var vars = [], hash;
    var hashes = window.location.href.slice(window.location.href.indexOf('?') + 1).split('&');
    for(var i = 0; i < hashes.length; i++) {
        hash = hashes[i].split('=');
        vars.push(hash[0]);
        vars[hash[0]] = hash[1];
    }
    return vars;
}

Array.prototype.clone = function() { return this.slice(0); };

Array.prototype.compareHistoryArray = function(array) {
  // Adapted from Stack Overflow: http://stackoverflow.com/questions/7837456/comparing-two-arrays-in-javascript
  if (!array) return false;

  if (this.length == 0 || array.length == 0 || this.length+1 != array.length) return false;

  for(var i = 0; i < this.length; i++) {
    if (this[i] != array[i]) {
      return false;
    }
  }
  return true;
}

var Stacks = {

  stack_json: {},
  pendingRequest: false,
  currentHash: [],
  setLevel: 0,
  currentStack: 0,
  previousArea: '',
  ieFix: false,
  landing_page: false,

  getPageJson: function() {
    Stacks.stack_json = landing_page_stack_array;
  },

  logBadStackRequest: function(stack, method) {
    if(window.Airbrake){
      Airbrake.notify({
        component: 'discovery',
        action: 'Stacks.' + method,
        message: 'Attempted to retrieve "' + stack + '" json. Currently at ' + window.location.host + window.location.pathname,
        errorType: 'Known Error'
      });
    }
  },

  // All stacks should be cached on the server, so these should be quick asyncronous calls.
  cacheAllStacks: function() {
    return;
    if (landing_page_stack_array != '') return;

    $('#stacks_content .main_stack li').each(function() {
      var stack = $(this).data('name');

      if(!stack || stack.match(/[^-_a-z]/i)) {
        Stacks.logBadStackRequest(stack, 'cacheAllStacks');
        return;
      }

      $.ajax({
        url: "/stacks/"+ stack +'.json',
        dataType: "json",
        success: function(json) {
          Stacks.stack_json[stack] = json[stack];
        },
        error: function(a,b,c) {
          log('### Error!');
          log(a+' | '+b+' | '+c);
        }
      });
    });
  },

  setTypeArray: function(callback, pathname) {

    if (Stacks.currentHash[0] == 'samsung') {
      Stacks.checkCallback(callback);
      return;
    }

    // If this doesn't exist in the current array, go get it.
    if (Stacks.currentHash[0] !== 'undefined' && typeof(Stacks.stack_json[Stacks.currentHash[0]]) === "undefined" && Stacks.currentHash[0] !== '') {

      var stack = Stacks.currentHash[0];
      if(!stack || stack.match(/[^-_a-z]/i)) {
        Stacks.logBadStackRequest(stack, 'setTypeArray');
        return;
      }

      if (Stacks.pendingRequest) Stacks.pendingRequest.abort();

      Stacks.pendingRequest = $.ajax({
        url: "/stacks/" + stack +'.json',
        dataType: "json",
        success: function(json) {
          Stacks.stack_json[Stacks.currentHash[0]] = json[Stacks.currentHash[0]];
          if (Stacks.ieFix) {
            Stacks.ieFix = false;
            if (pathname.substr(0,1) != '/') pathname = '/'+pathname;
            Stacks.buildHashFromUrl(pathname);
            Stacks.setRow(true);
          } else {
            Stacks.pendingRequest = null;
            Stacks.checkCallback(callback);
          }

        },
        error: function(a,b,c) {
          Stacks.pendingRequest = null;
          Stacks.checkCallback(callback);
        }
      });

    } else {
      Stacks.checkCallback(callback);
    }

  },

  checkCallback: function(callback) {
    if (typeof(callback) !== "undefined" && callback) callback.call(callback);
  },

  sortIt: function(o) {
    var a = [],i;
    for(i in o){
        if(o.hasOwnProperty(i)){
          a.push([i,o[i]]);
        }
    }
    a.sort(function(a,b){ return a[0]>b[0]?1:-1; });
    return a;
  },

  rSortIt: function(o) {
    var a = this.sortIt(o);
    return a.reverse();
  },

  countIt: function(arr) {
    var i = 0;
    for (var j in arr) {
      if (arr.hasOwnProperty(j)) i++
    }
    return i;
  },

  buildItemBlock: function(id, url, arr, cl) {
    var cla = Stacks.replaceClass(arr.internal_name, url);
    if (cl != '') cla = cla+' '+cl; 
    var data = { "class_name": cla, "id": id, "url": url, "name": Stacks.correctName(arr.name) };
    return _.template($('#item_block').html(), { value: data });
  },

  buildGridBlock: function(id, url, arr) {
    var data = { "id": id, "image_url": arr.image_url, "url": url, "name": Stacks.correctName(arr.name) };
    return _.template($('#grid_block').html(), { product: data });
  },

  replaceClass: function(name, url) {
    var add = (url.match(/ipad-air/) ) ? '_air' : '';
    return name.replace(/-/gi, '_')
      .replace(/4g_lte/, 'four_g_lte')
      .replace(/1st_gen/, 'first_gen'+add)
      .replace(/2nd_gen/, 'second_gen'+add)
      .replace(/3rd_gen/, 'third_gen'+add)
      .replace(/4th_gen/, 'forth_gen'+add);
  },

  positionHelpFloater: function() {
    if ($('#help_floater').css('display') != 'none') {
      var lef = 0;
      var top_off = 0;
      if (Stacks.currentHash[0] == 'ipod') {
        lef = (20+$('#stacks_content .level_2 li').last().offset().left+$('#stacks_content .level_2 li').last().width());
        top_off = ($('#stacks_content .level_2').first().offset().top+42);
      } else {
        lef = (50+$('#stacks_content .dropdown_row select').first().offset().left+$('#stacks_content .dropdown_row select').first().width());
        top_off = ($('#stacks_content .dropdown_row').first().offset().top+42);
      }
      if (lef < 520) lef = 520;
      $('#help_floater').offset({top: top_off, left: lef});
    }
  },

  checkPositionOfBottomStack: function(grid) {

    var sc_hei = $(window).scrollTop();
    var s_off_hei = ($('#stacks_content').height()+$('#stacks_content').offset().top);
    var w_hei = $(window).height();

    var off = 0;
    if (grid) {
      if ($('ul.grid').length > 0) off = $('ul.grid').parent().offset().top;
    } else if (s_off_hei > w_hei) {
      off = (s_off_hei-w_hei);
    }
    if (off > 0) {
      var isiPad = navigator.userAgent.match(/iPad/i) != null;
      if (!isiPad) {
        $("html, body").animate({ scrollTop: off }, 500);
      }
    }

  },

  setHeight: function(id,obj) {
    $(obj).find('li a').height(58);
    $('#stacks_content div.row').eq(id).find('ul').addClass('imageless');
    if ($('#stacks_content div.row').eq(id).find('.stack_help').length > 0) $('#stacks_content div.row').eq(id).find('.stack_help');
    // If displaying a dropdown...show the helper and move down to that position.
    if (Stacks.dropDownRow() && Stacks.currentStack >= 2 && ($('#stacks_content .dropdown_row').length > 0)) {
      if ($('#help_floater').css('display') == 'none') {
        $('#help_floater').css('display', 'block');
      }
      Stacks.positionHelpFloater();
    }
  },

  hideImagesInRow: function(id,animate) {
    if ($('#stacks_content div.row').eq(id).find('ul').hasClass('imageless')) return;
    if ($('.special_direct_content').length > 0 && id > 0) $('.special_direct_content').hide();
    if (id > 0 && Stacks.dropDownRow()) return;
    if (animate) {
      $('#stacks_content div.row').eq(id).find('ul').animate({height: '58px'}, 250, function() {
        Stacks.setHeight(id,$('#stacks_content div.row').eq(id).find('ul'));
      });
    } else {
      Stacks.setHeight(id,$('#stacks_content div.row').eq(id).find('ul'));
    }
  },

  dropDownRow: function() {
    if (Stacks.currentHash[0] == 'macbook' || Stacks.currentHash[0] == 'mac' || Stacks.currentHash[0] == 'ipod') {
      return true;
    }
    return false;
  },

  getNodeId: function() {
    // Create Node ID
    var prod_url = [];
    for (var q = 0; q < Stacks.currentHash.length; q++) {
      if (q !== 0) {
        prod_url.push(Stacks.currentHash[q]);
      }
    }
    return prod_url.join('/');
  },

  correctName: function(nam) {
    var nam_chk = nam.toLowerCase();
    if (nam_chk == 'at&t') nam = 'AT&T';
    if (nam_chk == 'verizon') nam = 'Verizon';
    if (nam_chk == 'sprint') nam = 'Sprint';
    if (nam_chk == 'unlocked') nam = 'Unlocked';
    if (nam_chk == 'wifi') nam = 'WIFI Only';
    if (nam_chk == 'apple tv') nam = 'Apple TV';
    if (nam_chk == 'other') nam = 'Other Carrier';
    return nam;
  },

  setRow: function(browserIsIE) {

    if (browserIsIE === undefined) browserIsIE = false;

    var expanded = false;
    if (typeof(getUrlVars()['expanded']) != "undefined") {
      if (getUrlVars()['expanded'] == 'true') {
        expanded = true;
      }
    }

    var animate = true;
    if (($.cookie(GazelleCookie.cookieName) == 1 && GazelleCookie.matchCookieLocation()) || expanded) { // This fires when they come back from the Calc Page

      Stacks.landing_page = false;

      // Erase all other rose and start over.
      for(var i = 1; i <= Stacks.currentHash.length; i++) {
        if ($('#stacks_content ul.level_'+i).length > 0) {
          $('#stacks_content ul.level_'+i).parent().remove();
        }
      }
      $('#stacks_content ul.grid').parent().remove(); // Remvoe Grid row.

      // Set first object.
      var obj = $('#stacks_content>div.row>ul').first().parent(); // Grab level_0

      // Add Level 1
      $('<div class="row cookie"><ul class="level_1"></ul><div class="clearfix"></div></div>').insertAfter($(obj));
      obj = $('#stacks_content>div.row>ul.level_1').parent();
      Stacks.buildTheRow(null, 1);

      var arr = [];
      for(var i = 1; i < (Stacks.currentHash.length-1); i++) {
        $('<div class="row cookie"><ul class="level_'+(i+1)+'"></ul><div class="clearfix"></div></div>').insertAfter($(obj));
        obj = $('#stacks_content>div.row>ul.level_'+(i+1)).parent();
        arr.push(Stacks.currentHash[i]);
        Stacks.buildTheRow(arr.join('/'), (i+1));
      }

      animate = false;
      $.cookie(GazelleCookie.cookieName, null, { path: '/' });
      $.cookie(GazelleCookie.cookieName+'_location', null, { path: '/' });
    }

    var top_most_stack = Number($('#stacks_content>div.row>ul').first().attr('class').match(/level_(.*)/)[1].replace('imageless', '').trim());
    var last_most_stack = Number($('#stacks_content>div.row>ul').last().attr('class').match(/level_(.*)/)[1].replace('imageless', '').trim());
    var current_stack_length = Stacks.currentHash.length;

    var len = $('#stacks_content>div.row>ul').length;
    for (var i = 0; i < len; i++) {
      if ($('#stacks_content>div.row>ul.level_'+i).length > 0) {
        var obj = $('#stacks_content>div.row>ul.level_'+i);
        if (i < (current_stack_length-1)) { // Hide if less than the row before.
          Stacks.hideImagesInRow(i,animate);
        }
        if (i == (current_stack_length-1)) { // The Stack above which should display.
          $(obj).find('li a').attr('style', '');
          if ($('.special_lp_content').css('display') != 'block') { // Added so that when clicking back on Samsung landing page it doesn't adjust height.
            $(obj).removeClass('imageless').css('height', 'auto');
            if ($('.special_direct_content').length > 0 && i < 2) $('.special_direct_content').show();
          }
          $(obj).find('li').css('height', 'auto');
          $(obj).find('li a').css('height', 'auto');
          if ($(obj).parent().find('.stack_help').length > 0) $(obj).parent().find('.stack_help');
        }
        if (i == current_stack_length) { // Current Stack.
          $(obj).parent().removeClass('set');
          $(obj).parent().removeClass('final');
          $(obj).find('li').removeClass('act');
          if ($('.special_lp_content').css('display') != 'block') { // Added so that when clicking back on Samsung landing page it doesn't adjust height.
            $(obj).removeClass('imageless').height('auto');
            if ($('.special_direct_content').length > 0 && i < 2) $('.special_direct_content').show();
          }
          if ($(obj).parent().find('.stack_help').length > 0) $(obj).parent().find('.stack_help');
        }
        if (i > current_stack_length) { // Any stack before.
          $(obj).parent().remove();
        }
        // Special Cases
        if (current_stack_length < 2) {
          $('#help_floater').hide();
          $('#stacks_content').css('height', 'auto');
        }
      } else {
        if ((i+1) < len) len++;
      }
      if (i >= 10) {
        log('Fatal error'); break;
      }
    }

    // If the row stack exists, empty it, otherwise build it.
    if ($('ul.level_'+Stacks.currentHash.length).length === 0) {
      var obj = $('ul.level_'+(Stacks.currentHash.length-1)).parent();
      $('<div class="row"><ul class="level_'+Stacks.currentHash.length+'"></ul><div class="clearfix"></div></div>').insertAfter($(obj));
    } else {
      if (Stacks.currentHash[0] !== undefined) $('#stacks_content ul.level_'+Stacks.currentHash.length).empty();
    }

    // Set lines and arrows under items it needs be.
    if (Stacks.currentHash[0] !== undefined) {
      $('#stacks_content div.row ul').each(function() {
        if($(this).html() !== '') {
          $(this).parent().addClass('set');
          $(this).find('li').removeClass('act');
          $('#stacks_content').attr('class', '').addClass(Stacks.currentHash[0]);
        }
      });
      for (var i = 0; i < Stacks.currentHash.length; i++) {
        if (((Stacks.currentHash[0] == 'ipod') && (i < 3)) || (Stacks.currentHash[0] != 'ipod')) {
          if (i === 0) {
            $('#stacks_content ul.level_0').find('li.'+Stacks.currentHash[i]).addClass('act');
          } else {
            $('#stacks_content').find('ul.level_'+i+' li[data-id="'+Stacks.currentHash[i]+'"]').addClass('act');
          }
        }
      }
    }

    // Next part makes sure array is set, then it builds the necessary rows.
    Stacks.setTypeArray(function() {
      Stacks.buildTheRow(Stacks.getNodeId(), Stacks.currentHash.length);
    });

  },

  buildTheRow: function(arr_str, row_id) {

      var i;
      var j;
      var gridBlock         = false;
      var dropdown_row      = false;
      var current_stack     = Stacks.stack_json[Stacks.currentHash[0]];
      var show_next_button  = false;

      // Check to see if this is a grid block.
      if (Stacks.currentHash[0] == 'apple_tv') { // I don't like this hardcoded in.
        gridBlock = true;
      } else if (current_stack.stacks) {
        if (((Stacks.countIt(current_stack.stacks)+1) == row_id) && (row_id > 0)) {
          gridBlock = true;
        }
      }

      // Pull Root Stack ID
      if (row_id == 1 && !gridBlock) { // If showing first row, pull Root!

        Stacks.setupRow(current_stack, current_stack.nodes.root.values, arr_str, row_id);
        Stacks.checkHelpSlug(current_stack.nodes.root, 1);

      } else if (!gridBlock) { // Otherwise if it's not a grid block.

        if (Stacks.dropDownRow()) { // Check to see if it's a dropdown row (Mac, Macbook)

          if (Stacks.currentHash[0] == 'ipod') {

            Stacks.setupRow(current_stack, current_stack.nodes[Stacks.currentHash[1]].values, arr_str, row_id);

          } else {
            var options = '';
            var vals = current_stack.nodes[arr_str].values;
            var stid = current_stack.nodes[arr_str].stack_id;
            var stack_name = current_stack.stacks[Number(stid)].name;
            var stack_iname = current_stack.stacks[Number(stid)].internal_name;

            // Create proper array to sort.
            var arr_sort = {};
            for (i in vals) {
              if (vals.hasOwnProperty(i)) {
                var num = Number(vals[i].id);
                arr_sort[current_stack.values[num].name] = {id: num, url: vals[i].url, name: current_stack.values[num].name};
              }
            }

            var arr = Stacks.sortIt(arr_sort);

            for (i in arr) {
              if (arr.hasOwnProperty(i)) {
                var chkd = '';
                if (Stacks.currentHash[row_id] == arr[i][1].id) {
                  chkd = ' selected="selected"';
                }
                options += '<option value="'+arr[i][1].url+'" data-id="'+arr[i][1].id+'"'+chkd+'>'+arr[i][1].name+'</option>';
              }
            }

            $('#stacks_content ul.level_'+row_id).append('<li><select id="'+stack_iname+'" class="fancy"><option value="" selected="selected">'+stack_name+'</option>'+options+'</select></li>');

          }

          Stacks.checkHelpSlug(current_stack.nodes[arr_str], row_id);

          dropdown_row = true;

        } else { // Just setup a normal row.

          Stacks.setupRow(current_stack, current_stack.nodes[arr_str].values, arr_str, row_id);
          Stacks.checkHelpSlug(current_stack.nodes[arr_str], row_id);

        }

      }

      if (gridBlock) { // If this is a product Grid row.

        if ($('#stacks_content a#back_button').length > 0) $('#stacks_content a#back_button').remove();

        var vals = '';
        if (Stacks.currentHash[0] == 'apple_tv') { // I don't like this hardcoded in.
          Stacks.checkHelpSlug(current_stack.nodes.root, 1);
          vals = current_stack.nodes.root.products;
        } else {
          Stacks.checkHelpSlug(current_stack.nodes[arr_str], row_id);
          vals = current_stack.nodes[arr_str].products;
        }

        if ((Stacks.dropDownRow() && vals.length == 1 && Stacks.currentHash[0] != 'ipod')) {
          var url = vals[0].url;
          $('#stacks_content ul.level_'+(row_id-1)).find('li').append('<a href="'+url+'" id="back_button" class="orange_button">Next</a>');
        } else {
          // Set Height of last dropdown row to push grid down.
          if ($('#stacks_content .dropdown_row').length > 0) {
            var spot1 = ($('#stacks_content .dropdown_row').last().height()+$('#stacks_content .dropdown_row').last().offset().top);
            var spot2 = ($('#help_floater').height()+$('#help_floater').offset().top);
            var new_hei = ($('#stacks_content .dropdown_row').last().height()+(spot2-spot1));
            $('#stacks_content').height('auto');
            $('#stacks_content .dropdown_row').last().height(new_hei+40);
          }

          // Create proper array to sort.
          var arr_sort = {};

          var j = 0;
          for (i in vals) {
            if (vals.hasOwnProperty(i)) {
              var num = Number(vals[i].id);
              var gid = current_stack.products[num].name;
              if (Stacks.currentHash[0] == 'ipod') { // Little trick to order them in size.
                gid = current_stack.products[num].name.split(' ').pop().toLowerCase().replace('gb', '');
                if (gid.length == 1) gid = '00'+gid;
                if (gid.length == 2) gid = '0'+gid;
              }
              arr_sort[gid+'_'+j] = {id: num, url: vals[i].url, name: current_stack.products[num].name};
              j++;
            }
          }

          var new_vals = Stacks.sortIt(arr_sort);

          for (i in new_vals) {
            if (new_vals.hasOwnProperty(i)) {
              var num = Number(new_vals[i][1].id);
              var url = new_vals[i][1].url;
              $('#stacks_content ul.level_'+row_id).append(Stacks.buildGridBlock(num, url, current_stack.products[num]));
            }
          }
          $('#stacks_content ul.level_'+row_id).addClass('grid');
          Stacks.checkGhostImage(row_id); // Cell Phones only.
          Stacks.centerStack(row_id,gridBlock);
          Stacks.findNames();

          // Add Final class to add border to bottom of a dropdown row.
          if (Stacks.dropDownRow()) $('#stacks_content ul.grid').parent().prev().addClass('final');

        }
      } else if (dropdown_row) {

        if ($('#stacks_content').height() < 750 && !$('.landing_page_get_started').length) {
          $('#stacks_content').height(750);
        }

          $('#stacks_content ul.level_'+row_id).parent().addClass('dropdown_row');
        if (Stacks.currentHash[0] != 'ipod') {
          Stacks.setupDropDownChange(row_id);
        } else {
          Stacks.setupClicks(row_id);
        }

      } else {

        $('#stacks_content ul.level_'+row_id).parent().removeClass('dropdown_row');

        Stacks.setupClicks(row_id);
        Stacks.checkSpecialOccurance(row_id); // Cell Phones and Tablets only.
        Stacks.centerStack(row_id,gridBlock);

        // Row has a single facet, we click it and show the next row
        if (!$.cookie(GazelleCookie.cookieName)) {
          Stacks.autoClickSingleFacetRow(current_stack, arr_str, row_id);
        }

      }

      Stacks.currentStack = row_id;
      Stacks.setupStackHelp(row_id);
      setTimeout(function() { Stacks.positionHelpFloater(); }, 500);

      if (!Stacks.landing_page) {
        setTimeout(function() { Stacks.checkPositionOfBottomStack(gridBlock); }, 500);
      } else {
        Stacks.landing_page = false;
      }
  },

  setupRow: function(current_stack, vals, arr_str, row_id) {
    var carrier_item = '';
    var carrier_item2 = '';

    // Create proper array to sort.
    var arr_sort = {};
    for (i in vals) {
      if (vals.hasOwnProperty(i)) {
        var num = Number(vals[i].id);
        var key = current_stack.values[num].name.replace('&', '').replace('-', '').toLowerCase();
        arr_sort[key] = {id: num, url: vals[i].url, name: current_stack.values[num].name};
      }
    }

    var new_vals;
    if ((Stacks.currentHash[0] == 'ipod' && row_id <= 2) || ((Stacks.currentHash[0] == 'iphone' || Stacks.currentHash[0] == 'ipad') && row_id == 1)) {
      new_vals = Stacks.rSortIt(arr_sort);
    } else {
      new_vals = Stacks.sortIt(arr_sort);
    }

    for (i in new_vals) {
      if (new_vals.hasOwnProperty(i)) {
        var num = Number(new_vals[i][1].id);
        var cla = '';
        if (typeof(current_stack.values[num].direct_link) !== 'undefined') cla = 'direct_link';
        var item = Stacks.buildItemBlock(num, new_vals[i][1].url, current_stack.values[num],cla);
        if (current_stack.values[num].internal_name == 'other') {
          carrier_item2 = item;
        } else if (current_stack.values[num].internal_name == 'unlocked' || current_stack.values[num].internal_name == 'wifi' || current_stack.values[num].internal_name == 'iphone-classic') {
          carrier_item = item;
        } else {
          $('#stacks_content ul.level_'+row_id).append(item);
        }
      }
    }
    if (carrier_item2 !== '') $('#stacks_content ul.level_'+row_id).append(carrier_item2);
    if (carrier_item !== '') $('#stacks_content ul.level_'+row_id).append(carrier_item);

    // Disabling special help until marketing decides on the style for it or we can remove it.
    //Stacks.getSpecialHelp(current_stack, row_id);
  },

  autoClickSingleFacetRow: function(current_stack, arr_str, row_id) {
    if (arr_str === '') return;

    if (current_stack.nodes[arr_str].values.length == 1 && !Stacks.arrivingFromChild()) {
      setTimeout(function(){$('#stacks_content ul.level_'+row_id+' li a').click();}, 50);
    } else {
      return;
    }
  },

  arrivingFromChild: function() {
    if (History.storedStates.length >= 2) {
      referrer = History.storedStates[History.storedStates.length-2].hash.split('/');
      current = History.storedStates[History.storedStates.length-1].hash.split('/');
      current.compareHistoryArray(referrer);
    } else {
      return false;
    }
  },

  checkSpecialOccurance: function(row_id) {

    if (Stacks.currentHash[0] === 'tablet' && Number(row_id) === 1) {

      var html = Stacks.buildItemBlock( 'APPLE_IPAD', '/ipad', {"name":"Apple","internal_name":"ipad_added"}, '' );
      $('ul.level_1').prepend(html);
      Stacks.setupClicks(1,$('ul.level_1 .ipad_added a'));

    } else if (Stacks.currentHash[0] === 'cell_phone' && row_id === 2) {

      // Add Help content.
      $('#stacks_content ul.level_'+row_id).css('paddingTop', '25px').parent().append('<div class="stack_help" style="margin-top: 10px; display: block;">Loading...</div>');
      $.ajax({
        url: '/content/help/cell_phone/carrier',
        success: function(content) {
          $('#stacks_content ul.level_'+row_id).parent().find('.stack_help').html(content);
          if (landing_page_stack === 'cell_phone' && window.location.pathname === '/sell/cell-phone/samsung') {
            $('#stacks_content ul.level_'+row_id).parent().find('.stack_help').addClass('samsung_help');
          }
        }
      })

      // Setup Other Carrier Button
      var spots = Stacks.getStackNames();
      var area_name = spots[0].replace(/ /g, '_').toLowerCase();
      var html = Stacks.buildItemBlock( 'OTHER_CARRIER', '#', {"name":"Other Carrier","internal_name":"other_ghost"}, '' );
      $('#stacks_content ul.level_'+row_id).append(html);

      var num = $('#stacks_content ul.level_'+row_id+' li').length;
      var len = (num/4);

      $('#stacks_content ul.level_'+row_id).find('.other_ghost').mouseover(function(e) {

        var off = $(this).offset();
        $('#stacks_content').append('<div id="ghost_info" class="stack_help ghost_box over">Loading...</div>');
        var tp = (off.top);
        var le = (off.left);

        $('#ghost_info').mouseout(function(e) {
          var to = e.toElement ? e.toElement : e.relatedTarget;
          if ($(to).closest('#ghost_info').length == 0) {
            $('#ghost_info').remove();
          }
        }).show().offset({top: tp, left: le});

        $.ajax({
          url: '/content/help/cell_phone/ghost/carrier',
          success: function(content) {
            $('#ghost_info').html(content);
          }
        });

      });
    }
  },

  checkGhostImage: function(row_id) {

    if (Stacks.currentHash[0] === 'cell_phone' || Stacks.currentHash[0].substr(0,6) === 'tablet') {

      var spots = Stacks.getStackNames();
      var area_name = spots[0].replace(/ /g, '_').toLowerCase();

      var spots = Stacks.getStackNames();
      if (Stacks.currentHash[0].substr(0,6) === 'tablet' && (area_name !== 'asus' && area_name !== 'samsung')) {
        return;
      }

      var data = { "class": area_name, "title": 'I don\'t see my '+spots[0]+' model' };
      var ghost_block = _.template($('#ghost_block').html(), { product: data });

      $('#stacks_content ul.level_'+row_id).append(ghost_block);

      var num = $('#stacks_content ul.level_'+row_id+' li').length;
      var len = (num/4);

      $('#stacks_content ul.level_'+row_id).find('.ghost').click(function(e) {
        e.preventDefault();
      }).mouseover(function(e) {
        var off = $(this).offset();
        if ($('#ghost_info').length == 0) {
          $('#stacks_content').append('<div id="ghost_info" class="stack_help ghost_box over">Loading...</div>');
        }
        var tp = (off.top+20);
        var le = (off.left+230);
        if ((len == Math.round(len)) || (num == 3)) { // Check for whole number.
          tp = off.top;
          le = off.left;
          $('#ghost_info').mouseout(function(e) {
            var to = e.toElement ? e.toElement : e.relatedTarget;
            if ($(to).closest('#ghost_info').length == 0) {
              $('#ghost_info').remove();
            }
          });
        }
        var url = '/content/help/'+Stacks.currentHash[0]+'/ghost/'+area_name;
        $('#ghost_info').show().offset({top: tp, left: le});
        $.ajax({
          url: url,
          success: function(content) {
            $('#ghost_info').html(content);
          }
        });
      });

      if (len != Math.round(len)) { // Check for whole number.
        $('#stacks_content ul.level_'+row_id).find('.ghost').mouseout(function(e) {
          var to = e.toElement ? e.toElement : e.relatedTarget;
          if ($(to).closest('#ghost_info').length == 0) {
            $('#ghost_info').remove();
          }
        });
      }
    }
  },

  getSpecialHelp: function(current_stack, row_id) {
    if(row_id !== 2) return;

    var help_slug;

    if($('#stacks_content ul.level_' + row_id + ' .unlocked').length) {
      help_slug = 'unlocked';
    } else if($('#stacks_content ul.level_' + row_id + ' .wifi').length) {
      help_slug = 'wifi';
    }

    if(help_slug) {
      $.ajax({
        url: '/content/help/special/' + help_slug,
        success: function(content) {
          $('#stacks_content ul.level_' + row_id + ' .' + help_slug).append('<div class="special_help hide"><div class="arrow-left"></div>' + content + '</div>');
          $('#stacks_content ul.level_' + row_id + ' .' + help_slug).mouseover(function() {
            $(this).find('.special_help').removeClass('hide');
          }).mouseout(function() {
            $(this).find('.special_help').addClass('hide');
          });
        }
      });
    }
  },

  centerStack: function(id,grid) {
    var wid = 0;
    var i = 0;
    $('#stacks_content ul.level_'+id).find('li').each(function() {
      if (!grid || (grid && (i < 4))) {
        wid += $(this).width();
        i++;
      }
    });
    $('#stacks_content ul.level_'+id).css('paddingLeft', Math.round((964-wid)/2));
  },

  changePageUrlLinks: function(url) {

    if (location.pathname != '/') {
      $('.social_widgets').hide();
    } else {
      $('.social_widgets').show();
    }

    Analytics.trackPageview(url);
    
  },

  setupDropDownChange: function(id) {
    $('#stacks_content ul.level_'+id+' select').change(function() {
      History.pushState({}, document.title, $(this).val());
    });
  },

  // Is called when new row is created.
  setupClicks: function(id,obj) {

    if (typeof(obj) == "undefined") {
      var obj = $('#stacks_content ul.level_'+id+' li a');
    }

    $(obj).click(function(e) {
      e.preventDefault();
      if ($(this).parent().data('id') === 'OTHER_CARRIER') {
        // Do Nothing
      } else if ($(this).parent().hasClass('direct_link')) {
        location = $(this).attr('href');
      } else if ($(this).parent().attr('class') === 'ipad_added') {
        location = '/ipad';
      } else if ($(this).parent().attr('class') === 'iphone_added') {
        location = '/iphone';
      } else {
        title = document.title
        History.pushState({}, null, $(this).attr('href'));
        document.title = title
      }
    }).mouseover(function() {
      if ($(this).closest('.grid').length === 0 && $(this).closest('.set').length === 0) {
        $(this).addClass('over');
        $(this).parent().parent().find("a:not(.over)").animate({opacity: 0.5}, 150);
        if ($(this).css('opacity') < 1) {
          $(this).animate({opacity: 1}, 150);
        }
      }
    }).mouseout(function(e) {
      if (!$(this).parent().parent().parent().hasClass('set')) {
        $(this).removeClass('over');
      }
    });
    $('#stacks_content ul.level_'+id).closest('div.row').mouseout(function(e) {
      var len = $(e.relatedTarget).closest('#stacks_content ul.level_'+id).length;
      if (len === 0) {
        $(this).find('a').removeClass('over').animate({opacity: 1}, 150);
      }
    });
  },

  checkHelpSlug: function(arr, row_id) {
    if (typeof(arr.help_slug) == "undefined") return;
    if (arr.help_slug !== null) {
      $.ajax({
        url: '/content/'+arr.help_slug,
        success: function(content) {
          if (Stacks.dropDownRow() && row_id >= 2 && ($('#stacks_content .dropdown_row').length > 0)) {
            $('#help_floater').html(content);
          } else {
            if ($('#stacks_content ul.level_'+row_id).parent().find('.stack_help').length > 0)
              $('#stacks_content ul.level_'+row_id).parent().find('.stack_help').remove();
            $('#stacks_content ul.level_'+row_id).parent().prepend('<div class="stack_help">'+content+'</div>').find('.stack_help').css('marginTop', 10);
            Stacks.setupStackHelp(row_id);
            Stacks.repositionProductHeadline();
          }
        }
      });
    } else if ($('#stacks_content ul.level_'+row_id).parent().find('.stack_help').length > 0) {
      $('#stacks_content ul.level_'+row_id).parent().find('.stack_help').remove();
    }
  },

  setupStackHelp: function(id) {
    $('#stacks_content ul.level_'+id).parent().find('.stack_help').mouseover(function() {
      $(this).addClass('over');
    }).mouseout(function(e) {
      if ($(e.relatedTarget).closest('.stack_help').length === 0) {
        $(this).removeClass('over');
      }
    });
  },

  buildHashFromUrl: function(pathname) {
    pathname = pathname.split('?')[0];
    if (pathname == '/samsung') pathname = '/sell/cell-phone/samsung';
    var fnd = false;
    var arr = Stacks.stack_json[Stacks.currentHash[0]].nodes;
    for (var i in arr) {
      if (!arr.hasOwnProperty(i) || arr[i].values === undefined) continue;
      for (var j = 0; j < arr[i].values.length; j++) {
        if (arr[i].values[j].url == pathname) {
          fnd = true;
          Stacks.currentHash =[Stacks.currentHash[0]];
          if (i != 'root') {
            var hash_arr = i.split('/');
            for (var k = 0; k < hash_arr.length; k++) {
              Stacks.currentHash.push(hash_arr[k]);
            }
          }
          Stacks.currentHash.push(arr[i].values[j].id);
          break;
        }
      }
      if (fnd) break;
    }
    return fnd;
  },

  findNames: function() {
    var myStack = Stacks.stack_json[Stacks.currentHash[0]];
    var spots = [];
    for(var i = 1; i < Stacks.currentHash.length; i++) {
      spots.push(myStack.values[Stacks.currentHash[i]].name);
    }
    if ($('#stacks_content ul.level_'+Stacks.currentHash.length).parent().find('.product_headline').length > 0) {
      $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().find('.product_headline').remove();
    }
    switch(Stacks.currentHash[0]) {
      case 'cell_phone':
        $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend('<h3 class="product_headline">These are the only '+Stacks.correctName(spots[0])+' '+Stacks.correctName(spots[1])+' cell phones we buy. <span>Please be sure your model numbers match the ones below.</span></h3>');
        break;
      case 'iphone':
        $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend('<h3 class="product_headline">Select your '+Stacks.correctName(spots[0])+' '+Stacks.correctName(spots[1])+' to sell.</h3>');
        break;
      case 'ipad':
        $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend('<h3 class="product_headline">Select your '+Stacks.correctName(spots[1])+' '+Stacks.correctName(spots[0])+' to sell.</h3>');
        break;
      case 'tablet':
        $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend('<h3 class="product_headline">Select your '+Stacks.correctName(spots[0])+' '+Stacks.correctName(spots[1]).replace('Gen', 'Generation')+' to sell.</h3>');
        break;
      case 'ipod':
        $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend('<h3 class="product_headline">Select your iPod '+Stacks.correctName(spots[0])+' '+Stacks.correctName(spots[1]).replace('Gen', 'Generation')+' to sell.</h3>');
        break;
      case 'mac':
        $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend('<h3 class="product_headline">Select your '+Stacks.correctName(spots[0])+' to sell.</h3>');
        break;
      case 'macbook':
        $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend('<h3 class="product_headline">Select your '+Stacks.correctName(spots[0])+' to sell.</h3>');
        break;
      case 'apple_display':
        $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend('<h3 class="product_headline">Select your '+Stacks.correctName(spots[0])+' to sell.</h3>');
        break;
    }
    Stacks.repositionProductHeadline();
  },

  getStackNames: function() {
    var spots = [];
    for(var i = 1; i < Stacks.currentHash.length; i++) {
      spots.push(Stacks.correctName(Stacks.stack_json[Stacks.currentHash[0]].values[Stacks.currentHash[i]].name));
    }
    return spots;
  },

  repositionProductHeadline: function() {
    var li_obj = $('#stacks_content ul.level_'+Stacks.currentHash.length).parent();
    if ($(li_obj).find('.stack_help').length > 0 && $(li_obj).find('.product_headline').length > 0) {
      var obj = $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().find('.product_headline');
      $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().prepend(obj);
      $('#stacks_content ul.level_'+Stacks.currentHash.length).parent().find('.stack_help').css('marginTop', '45px');
      $('#stacks_content ul.level_'+Stacks.currentHash.length).css('paddingTop', '30px');
      //$('#stacks_content ul.level_'+Stacks.currentHash.length).parent().find('.product_headline').css('paddingTop', 40);
    }
  },

  checkNames: function() {
    $('#stacks_content ul li h4').each(function() {
      var val = $(this).text();
      $(this).text(Stacks.correctName(val));
    });
  },

  getInternetExplorerVersion: function() {
    var rv = -1; // Return value assumes failure.
    if (navigator.appName == 'Microsoft Internet Explorer') {
      var ua = navigator.userAgent;
      var re = new RegExp("MSIE ([0-9]{1,}[.0-9]{0,})");
      if (re.exec(ua) !== null)
        rv = parseFloat( RegExp.$1 );
    }
    return rv;
  },

  checkOnSamsung: function() {
    if (Stacks.currentHash[0] != 'samsung' || Stacks.currentHash.length < 2) return;
    var arr = [];
    for(var i = 1; i < Stacks.currentHash.length; i++) {
      var str = (i > 1) ? arr.join('/') : null;
      $('<div class="row"><ul class="level_'+i+'"></ul><div class="clearfix"></div></div>').insertAfter($('.level_'+(i-1)).parent());
      Stacks.buildTheRow(str, i);
      arr.push(Stacks.currentHash[i]);
    }
  },

  init: function() {

    Stacks.cacheAllStacks(); // Start Caching all the stacks.

    Stacks.centerStack(0,false); // Center right away.

    (function(window,undefined) {

      if ($.cookie(GazelleCookie.cookieName) == 1 && GazelleCookie.matchCookieLocation()) {
        if ($.cookie('gazelle_samsung_landing_page') == 1) {
          $('.main_content').addClass('samsung_direct');
          $('.level_1').height(58);
        } else if ($.cookie('gazelle_samsung_landing_page') == 2) {
          $('.main_stack').parent().removeClass('hide');
          $('.main_content').removeClass('samsung');
        } else {
          $('#stacks_content .level_0').parent().removeClass('hide');
        }
      }

      // On load, if it's Samsung Page #2 set a cookie for back button return.
      if (location.pathname == '/landing-page/cell-phone/samsung') {
        $.cookie('gazelle_samsung_landing_page', '1', { path: '/' });
      } else if (location.pathname == '/samsung') {
        $.cookie('gazelle_samsung_landing_page', '2', { path: '/' });
      } else {
        $.cookie('gazelle_samsung_landing_page', null, { path: '/' });
      }


      // Establish Variables
      var History = window.History;
      var State = History.getState();

      // Get Pathname
      var pathname = State.hash.split('?')[0].replace('.', '');
      if (pathname.substr(0,1) != '/') pathname = '/'+pathname;
      if (Stacks.getInternetExplorerVersion() > 0) {
        var re = new RegExp(location.protocol+'//'+location.host, "gi");
        pathname = State.cleanUrl.replace(re, '');
      }

      // Bind to State Change
      History.Adapter.bind(window,'statechange',function() {

        var State = History.getState();

        // Get Pathname
        var pathname = State.hash.replace('.', '');
        if (pathname.substr(0,1) != '/') pathname = '/'+pathname;

        // If it's IE we need to work some magic because overall suck.
        if (Stacks.getInternetExplorerVersion() > 0) {
          var re = new RegExp(location.protocol+'//'+location.host, "gi");
          pathname = State.cleanUrl.replace(re, '');
        }

        var fnd = false;
        var c_stack = Stacks.currentHash;

        Stacks.changePageUrlLinks(State.hash);

        // Verify Hash if there is something there.
        if (pathname == '/') {
          Stacks.previousArea = Stacks.currentHash[0];
          Stacks.currentHash = [];
        } else {
          if (Stacks.stack_json[Stacks.currentHash[0]] !== undefined) {
            fnd = Stacks.buildHashFromUrl(pathname);
          }
          if (!fnd) {
            Stacks.currentHash = [Stacks.currentHash[0]];
          }
        }

        if (!fnd) {
          $('ul.main_stack li a').each(function() {
            if ($(this).attr('href') == pathname) {
              Stacks.currentHash = [$(this).parent().attr('class').replace('act', '').trim()];
            }
          });
        }

        // Track Category Change
        if (Stacks.currentHash[0] != c_stack[0]) {
          Analytics.setSuperProperty({ "category": Stacks.currentHash[0] });
        }

        Stacks.setRow();

      });

      if (Stacks.getInternetExplorerVersion() > 0 && pathname !== '' && pathname !== '/') { // Returning to page from Calc, but in IE8 or IE9

        // Need to retrieve JSON before we do anything.
        if (pathname.substr(0,1) == '/') pathname = pathname.substr(1,pathname.length);
        if (pathname.split('?').length > 1) { // Check for URLVars
          pathname = pathname.split('?')[0];
        }
        var path_arr = pathname.split('/');
        var loc = path_arr[0].replace(/-/gi, '_');
        if (loc == 'landing_page') { // Added to allow Samsung Direct landing page to work.
          loc = 'samsung';
        } else if (loc == 'samsung' || location.pathname == '/samsung') { // Added to allow Samsung landing page to work.
          loc = 'cell_phone';
        } else if (loc == 'sell') {
          loc = path_arr[1].replace(/-/gi, '_');
        }
        Stacks.currentHash = [loc];
        $('#stacks_content').addClass(loc);
        Stacks.ieFix = true;
        Stacks.setTypeArray(null, pathname);
        if (loc == 'samsung') { // Added to allow Samsung Direct landing page to work.
          if (pathname.substr(0,1) != '/') pathname = '/'+pathname;
          Stacks.getPageJson();
          Stacks.buildHashFromUrl(pathname);
          Stacks.checkOnSamsung();
          Stacks.setRow();
        }

      } else if (pathname !== '' && pathname !== '/' && Stacks.currentHash[0] === undefined && pathname !== '/sell/apple-tv-display' && pathname !== '/sell/apple-computers') { // Returning to page from Calc
        if (typeof(landing_page_stack) != "undefined") {
          Stacks.landing_page = true;
          Stacks.currentHash = [landing_page_stack];
          $('#stacks_content').addClass(landing_page_stack);
          Stacks.getPageJson();
          Stacks.buildHashFromUrl(pathname);
          Stacks.checkOnSamsung();
          Stacks.setRow();
          if (landing_page_stack === 'cell_phone' && $('.main_stack').hasClass('level_1')) {
            var html = Stacks.buildItemBlock( 'APPLE_PHONE', '/iphone', {"name":"Apple","internal_name":"iphone_added"}, '' );
            $('ul.main_stack').prepend(html).css('paddingTop', '20px');
            Stacks.centerStack(1, false);
            Stacks.setupClicks(1,$('ul.main_stack .iphone_added a'));
          }
        }
      } else {
        Analytics.criteoArriveAtSite();
        $.cookie(GazelleCookie.cookieName, null, { path: '/' });
      }
      Stacks.checkNames();

    })(window);

    // If landing page need to add clicks to items there
    var id = 0;
    if (typeof($('#stacks_content .row ul').attr('class')) != "undefined") {
      var arr = $('#stacks_content .row ul').attr('class').split(' ');
      for(var i = 0; i < arr.length; i++) {
        if (arr[i].match(/level_(.*)/)) {
          id = Number(arr[i].split('_')[1]);
          break;
        }
      }
      // TODO: Need to check if it's a grid.
      if (id !== undefined) {
        Stacks.centerStack(id, false);
        this.setupClicks(id);
      }
    }

  }
};

function landingPageSetup() {
  var getStartedBtn = $('.landing_page_get_started');
  if (!getStartedBtn.length) return;
  var stacks_name = $(getStartedBtn).data('stacks');
  // This Macbook Pro case is horrible
  if (stacks_name == 'macbook_pro') {
    var screenSize = $('.level_2').closest('div');
    var helpFloater = $('#help_floater');
    screenSize.hide();
    helpFloater.addClass('hide');
    getStartedBtn.on('click', function() {
      screenSize.slideDown();
      helpFloater.removeClass('hide');
      Stacks.positionHelpFloater();
      $('#stacks_content').height(750);
    });
  } else {
    $('#stacks_content div.row').hide();
    $(getStartedBtn).on('click', function() {
      if (stacks_name) {
        $('ul.level_1 > li.' + stacks_name + ' a').first().click();
        $('.level_2').closest('div').slideDown();
      } else {
        $('.level_1').parent().slideDown();
      }
      Stacks.centerStack(2, false);
    });
  }
}

$(document).ready(function() {
  $('#three_questions a.opener').click(function(e) {
    e.preventDefault();
    if ($('#three_questions span.dots').css('display') == 'none') {
      $('#three_questions span.dots').show();
      $('#three_questions span.additional').hide();
    } else {
      $('#three_questions span.dots').hide();
      $('#three_questions span.additional').show();
    }
  });
  $('#three_questions span.dots').show();
  Stacks.init();
  landingPageSetup();
});
